3. Location information: To provide you with commuting suggestions;
4. Event information: To provide you with reminders to turn your phone to silent during meetings, we need to analyze your event information. Using semantic technology along with the relevant third-party services, we will identify which events are meetings so we can send you reminders on time;
5. SMS message information: To provide you with services related to flights, trains, movies, hotels, express deliveries, etc., we need to analyze SMS messages on your device. We will upload the analyzed results to the server only to update you with the latest service information. For example, we will obtain your flight information to display your itinerary and offer you query services;
6. Behavioral data, including feature usage statistics: To improve our product features and personalize your user experience, we will optimize the layout of our interface based on the behavioral data of the majority of our users.
We will strictly abide by the aforementioned purposes when using your personal information. Your personal information will only be used for the purposes that have been established at the time of collection with your consent. In the event that such information may be used for any other purposes, we will seek your prior consent before proceeding. In addition, we will take all reasonable, feasible, and pertinent organizational and technical measures to protect your personal information from unauthorized access, public disclosure, use, modification, damage, or loss. For example, we will use encryption technology to ensure the security of data transmission and storage. 
